use crate::{blockscout, Contract, Error};
use blockscout_display_bytes::ToHex;
use ethers_core::types;

#[derive(Clone, Debug, PartialEq, Eq)]
pub struct AddressDetails {
    pub chain_id: String,
    pub address: types::Address,
    pub transaction_hash: Option<types::TxHash>,
    pub block_number: Option<u128>,
    pub transaction_index: Option<u128>,
    pub deployer: Option<types::Address>,
    pub creation_code: Option<types::Bytes>,
    pub runtime_code: types::Bytes,
}

pub async fn batch_retrieve_address_details(
    contracts: &[(&blockscout::Client, Contract)],
) -> Vec<Result<AddressDetails, Error>> {
    let mut contract_details = vec![];
    for (client, contract) in contracts {
        let details = retrieve_address_details(client, contract).await;

        contract_details.push(details);
    }
    contract_details
}

pub async fn retrieve_address_details(
    client: &blockscout::Client,
    contract: &Contract,
) -> Result<AddressDetails, Error> {
    let mut address_details = AddressDetails {
        chain_id: contract.chain_id.clone(),
        address: contract.address,
        transaction_hash: None,
        block_number: None,
        transaction_index: None,
        deployer: None,
        creation_code: None,
        runtime_code: Default::default(),
    };

    fetch_and_apply_address_endpoint_response(&mut address_details, client).await?;
    fetch_and_apply_smart_contract_endpoint_response(&mut address_details, client).await?;
    fetch_and_apply_transaction_endpoint_response(&mut address_details, client).await?;

    Ok(address_details)
}

async fn fetch_and_apply_address_endpoint_response(
    address_details: &mut AddressDetails,
    client: &blockscout::Client,
) -> Result<(), Error> {
    let request = blockscout::GetAddress {
        address: address_details.address,
    };
    let response = client.request(&request).await;
    let address = match response {
        Ok(address) if !address.is_contract => return Err(Error::not_contract()),
        Ok(address) => address,
        Err(api_client_framework::Error::NotFound) => return Err(Error::not_contract()),
        Err(err) => {
            tracing::error!(
                contract_address = address_details.address.to_hex(),
                source = std::error::Error::source(&err),
                "internal error while retrieving address details: {err}"
            );
            return Err(Error::internal(format!(
                "Error while retrieving address details: {err}"
            )));
        }
    };
    match (
        address.creation_transaction_hash,
        address.creator_address_hash,
    ) {
        (None, None) => {}
        (Some(transaction_hash), None) => {
            tracing::error!(
                contract_address = address_details.address.to_hex(),
                transaction_hash = transaction_hash.to_hex(),
                "retrieved address has creation transaction hash, but does not have creator"
            );
            return Err(Error::internal(
                "Address has creation transaction hash, but does not have creator",
            ));
        }
        (None, Some(creator_address)) => {
            tracing::error!(
                contract_address = address_details.address.to_hex(),
                creator_address = creator_address.to_hex(),
                "retrieved address has creator, but does not have transaction hash"
            );
            return Err(Error::internal(
                "Address has creator, but does not have transaction hash",
            ));
        }
        (Some(transaction_hash), Some(creator_address)) => {
            address_details.transaction_hash = Some(transaction_hash);
            address_details.deployer = Some(creator_address);
        }
    }

    Ok(())
}

async fn fetch_and_apply_smart_contract_endpoint_response(
    address_details: &mut AddressDetails,
    client: &blockscout::Client,
) -> Result<(), Error> {
    let request = blockscout::GetSmartContract {
        address: address_details.address,
    };

    let smart_contract = client.request(&request).await.map_err(|err| {
        tracing::error!(
            contract_address = address_details.address.to_hex(),
            "internal error while retrieving smart-contract details: {err}"
        );
        Error::internal("Error while retrieving smart-contract details")
    })?;

    let runtime_code = smart_contract.deployed_bytecode.ok_or_else(|| {
        tracing::warn!(
            contract_address = address_details.address.to_hex(),
            "Address is contract, but does not contain runtime code"
        );
        Error::no_runtime_code()
    })?;
    address_details.runtime_code = runtime_code.into();
    address_details.creation_code = smart_contract.creation_bytecode.map(|value| value.into());

    Ok(())
}

async fn fetch_and_apply_transaction_endpoint_response(
    address_details: &mut AddressDetails,
    client: &blockscout::Client,
) -> Result<(), Error> {
    let hash = match address_details.transaction_hash {
        None => return Ok(()),
        Some(hash) => hash,
    };

    let request = blockscout::GetTransaction { hash };
    let transaction = client.request(&request).await.map_err(|err| {
        tracing::error!(
            transaction_hash = hash.to_hex(),
            "internal error while retrieving transaction details: {err}"
        );
        Error::internal(format!("Error while retrieving transaction details: {err}"))
    })?;
    address_details.block_number = Some(transaction.block_number);
    address_details.transaction_index = Some(transaction.position.into());

    Ok(())
}

#[cfg(test)]
mod tests {
    use super::*;
    use pretty_assertions::assert_eq;
    use std::str::FromStr;
    use tracing_test::traced_test;
    use url::Url;

    fn to_address(value: &str) -> types::Address {
        types::Address::from_str(value).unwrap()
    }

    fn to_bytes(value: &str) -> types::Bytes {
        types::Bytes::from_str(value).unwrap()
    }

    fn to_tx_hash(value: &str) -> types::TxHash {
        types::TxHash::from_str(value).unwrap()
    }

    #[traced_test]
    #[tokio::test]
    async fn test_retrieve_address_details() {
        let client = blockscout::Client::new(
            Url::parse("https://base.blockscout.com").unwrap(),
            "".to_string(),
        )
        .await;

        let test_cases = [
            ("not_a_contract", "0x2E0deA15f32949e027682C70A8afDc7c8e5eB1a5", Err(Error::not_contract())),
            ("not_existing_address", "0xCAfEcAfeCAfECaFeCaFecaFecaFECafECafe1111", Err(Error::not_contract())),
            ("self-destructed","0x6bd73391812d22510980d9415c62887af6ff4f0f", Err(Error::no_runtime_code())),
            ("genesis", "0x13b0D85CcB8bf860b6b79AF3029fCA081AE9beF2",
             Ok(AddressDetails {
                 chain_id: "10".to_string(),
                 address: to_address("0x13b0D85CcB8bf860b6b79AF3029fCA081AE9beF2"),
                 transaction_hash: None,
                 block_number: None,
                 transaction_index: None,
                 deployer: None,
                 creation_code: None,
                 runtime_code: to_bytes(""),
             })),
            ("from_transaction", "0x8Ab178C07184ffD44F0ADfF4eA2ce6cFc33F3b86",
             Ok(AddressDetails {
                 chain_id: "10".to_string(),
                 address: to_address("0x8Ab178C07184ffD44F0ADfF4eA2ce6cFc33F3b86"),
                 transaction_hash: Some(to_tx_hash("0x574771bcc170f30c87f67dd2734dd2f5ef59c15ca67466ab002af08d767acbe9")),
                 block_number: Some(8616108),
                 transaction_index: Some(7),
                 deployer: Some(to_address("0x9BC9CA7e6A8F013f40617c4585508A988DB7C1c7")),
                 creation_code: Some(to_bytes("")),
                 runtime_code: to_bytes(""),
             })),
            ("from_internal", "0x5baBfc2F240bc5De90Eb7e19D789412dB1dEc402", Ok(AddressDetails {
                chain_id: "10".to_string(),
                address: to_address("0x5baBfc2F240bc5De90Eb7e19D789412dB1dEc402"),
                transaction_hash: Some(to_tx_hash("0xdd878faf22d0f8e7f3bce69f6a6d7f9f0c42442e01e65b3a24157020b97f72ce")),
                block_number: Some(10287314),
                transaction_index: Some(1),
                deployer: Some(to_address("0x87aF913718f73168D4566bBF51683792aC2680eB")),
                creation_code: Some(to_bytes("")),
                runtime_code: to_bytes(""),
            })),
            ("unverified", "0x6e53131F68a034873b6bFA15502aF094Ef0c5854", Ok(AddressDetails {
                chain_id: "10".to_string(),
                address: to_address("0x6e53131F68a034873b6bFA15502aF094Ef0c5854"),
                transaction_hash: Some(to_tx_hash("0x3ab20ef6048b87d9a096114630281d2c83fbc642b049d637d180c5fae3fe2975")),
                block_number: Some(3236991),
                transaction_index: Some(2),
                deployer: Some(to_address("0xA5961898870943c68037F6848d2D866Ed2016bcB")),
                creation_code: Some(to_bytes("")),
                runtime_code: to_bytes(""),
            })),
        ];

        for (name, address, expected) in test_cases {
            let actual = retrieve_address_details(
                &client,
                &Contract {
                    chain_id: "10".into(),
                    address: to_address(address),
                },
            )
            .await;
            assert_eq!(expected, actual, "{name}; invalid address details");
        }
    }
}
